// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

/**
 * @title For ERC721 Library
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-8-14 | VERSION: v1.0.2
 */

library NftLibrary {
    struct DetailStruct {
        uint8 quality;   // quality for card
        uint16 heroId;   // hero id for card
        uint8 power;     // power for card
        uint16 rate;     // reward rate for card
        uint256 amount;  // sale amount for card
        uint112 tokenId; // tokenId for card
    }

    struct CardStruct {
        uint16 start;  // reward rate start for card
        uint16 plus;   // reward rate plus for card
        uint8 power;   // power for card
        uint32[] role; // number of roles remaining
    }

    struct RateStruct {
        uint8 number;  // exchange reward number for card
        uint16 rate;   // exchange reward rate for card
        uint8 times;   // exchange reward times for card
    }

    struct UserStruct {
        uint256 powers;   // record user's total power
        uint256 period;   // record first buy timestamp
        uint256 exchange; // record reward exchange
    }

    uint8 constant private BIT_QUALITY   = 96; // uint 8
    uint8 constant private BIT_HEROID    = 88; // uint 8
    uint8 constant private BIT_POWER     = 80; // uint 8
    uint8 constant private BIT_CARDRATE  = 64; // uint 16
    uint8 constant private BIT_AMOUNT    = 32; // uint 32

    function random(uint256 value_) public view
        returns (uint256 result) {

        bytes32 h = keccak256(abi.encodePacked(
            block.timestamp, block.number
        ));

        bytes memory seed = abi.encodePacked(h);
        result = uint256(keccak256(seed)) % value_;
        result = result == 0 ? value_ : result;
    }

    function generate(DetailStruct memory cs_) public
        view returns (uint112 tokenId) {

        tokenId = 1 << 111 |
        uint112(uint8(cs_.quality))         << BIT_QUALITY |
        uint112(uint8(cs_.heroId))          << BIT_HEROID |
        uint112(uint8(cs_.power))           << BIT_POWER |
        uint112(uint16(cs_.rate))           << BIT_CARDRATE |
        uint112(uint32(cs_.amount / 1e18))  << BIT_AMOUNT |
        uint112(uint32(block.timestamp)) << 0;
    }

    function analysis(uint112 tokenId_) public pure
        returns (DetailStruct memory cs) {

        cs.quality = uint8(tokenId_  >> BIT_QUALITY);
        cs.heroId  = uint8(tokenId_  >> BIT_HEROID);
        cs.power   = uint8(tokenId_  >> BIT_POWER);
        cs.rate    = uint16(tokenId_ >> BIT_CARDRATE);
        cs.amount  = uint32(tokenId_ >> BIT_AMOUNT);
    }
}

